    "    print(feature_importance.head(5).to_string(index=False))\n",
    "    \n",
    "    # 주요 부정적 영향 요인 출력\n",
    "    print(\"\\n승리에 부정적 영향을 미치는 주요 컬럼 (계수 기준 오름차순 하위 5개):\")\n",
